import React from "react";

const Button = React.forwardRef(({ children, className, dataid, onClick }, ref) => {
  return (
    <button
      className="flex h-[70px] transform select-none items-center justify-center rounded-sm bg-light-200 
        text-xl font-[400] text-textDark outline-none transition-all hover:bg-orange-500 hover:text-white 
        focus:ring-2 focus:ring-orange-500 active:scale-95 active:bg-orange-700 dark:text-text"
      onClick={onClick}
      ref={ref}
      data-testid={dataid}
    >
      {children}
    </button>
  );
});

export default Button;
